DROP TABLE IF EXISTS `t_moe_reply`;

CREATE TABLE `t_moe_reply` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `comment_id` int(11) DEFAULT NULL COMMENT '评论ID,对应commit表自增id',
  `content` text COMMENT '回复内容',
  `like_count` int(11) DEFAULT NULL COMMENT '点赞数',
  `reply_owner_uid` int(11) DEFAULT NULL COMMENT '回复用户uid',
  `reply_target_uid` int(11) DEFAULT NULL COMMENT '回复目标UID',
  `reply_type` int(11) DEFAULT NULL COMMENT '回复类型，1针对评论的恢复，2针对目标 恢复',
  `reply_id` int(11) DEFAULT NULL COMMENT '如果reply_type是comment的话，那么reply_id＝commit_id，如果reply_type是reply的话，这表示这条回复的父回复。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

